import { useEffect, useState } from 'react';
import './App.css'
import Botao from './Botao';








function App() {

 const Numeros = Array.from({ length: 25 }, (e, i) => i + 1).sort(() => Math.random() - 0.5).filter((e, i) => i < 15);


 const listaNumeros = Numeros.map((e,i)=> <div key={e}>{i.toString()}</div>)








return (
  <div>
    <div>
      {listaNumeros}
    </div>
    <button onClick={() =>console.log(listaNumeros)}>Gerar</button>  
    </div>
)

}

export default App;
